import React, { useRef } from 'react'
import { Container, Form } from 'react-bootstrap'

export default function Login() {
    const idRef = useRef()

    return (
        <Container>
            <Form.Group>
                <Form.Label>Enter Your ID</Form.Label>
                <Form.Control type="text" ref={idRef} required></Form.Control>
            </Form.Group>
        </Container>
    );
}
